import styles from './Reservas.module.css';
import { useState } from 'react';

function Reservas() {
    const [interBarra, setInterBarra] = useState(false);
    const obj = ['holis', 'ohli', 'bhdbcj', 'holis', 'ohli', 'bhdbcj', 'holis', 'ohli', 'bhdbcj'];
    const hey = {
        holis: 'chao',
        bhjb: 'chao',
        holcsdis: 'chao',
        hocdsdlis: 'chao',
        holcsdcdscis: 'chao',
        hocdscdscdsdlis: 'chao',
        holcscdscsdis: 'chao',
        hocdscscsdlis: 'chao',
        holcsdcssis: 'chao',
        hocdsdcdsclis: 'chao',
    };

    function handleInterBarra() {
        setInterBarra(!interBarra);
        return interBarra;
    }
    function handleNumber(number) {
        if (number % 2 === 0) return true;
        return false
    }

    return (
        <div className={styles.bigContainer}>
            <form className={styles.formBigContainer}>
                <div className={styles.codigoLabel}>
                    <label htmlFor="">CÃ³digo de reserva:</label>
                    <input type="text" />
                </div>
                <div className={styles.reservasBigContainer}>
                    <div className={styles.reservasTitulo}>
                        <p>RESERVAS</p>
                    </div>
                    <div className={styles.tablaParams}>
                        <p className={styles.param1}>holis</p>
                        <p className={styles.param2}>holis</p>
                        <p className={styles.param3}>holis</p>
                    </div>
                    <div id={styles.desplegableOnn} className={styles.desplegable}>
                        {obj && obj.map((o, index) => {
                            return (
                                <div id={handleNumber(index) ? styles.color1 : styles.color2} className={styles.barra2}>
                                    <div className={styles.fechaSaved}>{o}</div>
                                    <ul>
                                        {Object.entries(hey).map(([key, value]) => {
                                            return <li>{key}{value}</li>
                                        })}
                                    </ul>
                                    <button onClick={(e) => { e.preventDefault() }} className={styles.checkIcon}>
                                        Anular hora
                                    </button>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </form>
        </div>
    );
}

export default Reservas;
